import React from 'react';
import help from '../images/help3.jpeg';
import {Link} from 'react-router-dom';
import "../styles/slider.css"
import { loremIpsum } from 'react-lorem-ipsum';
import "bootstrap-icons/font/bootstrap-icons.css";







function Slider2 () {
    return( 
        
        <div id="carouselExampleCaptions" class="carousel slide" data-bs-ride="false">
        <div class="carousel-inner">

          <div class="carousel-item active">

            <img src={help} class="d-block min-vh-100 w-100" alt="..."/>
            <div class="carousel-caption">
              <h5 class="fs-1">Contact Us</h5>
              <p>{loremIpsum()}</p>
              <div class="slider-btn mt-4">

                <button class="btn btn-primary mt-3">Contact us on email.</button> 
                <button class="btn btn-secondary ms-lg-3 mt-3">Contact us on email.</button>

                <div class="social-buttons mt-lg-3 mt-3 ">
                <button onClick={(e) => {
                e.preventDefault();
                window.location.href='https://www.facebook.com/';
                }}class="btn btn-primary btn-circle rounded-circle "style={{fontSize: '1.5rem'}}>
                <i class="bi bi-facebook" style={{fontSize: '1.5rem', color: 'black'}} ></i>
                </button>

                <button onClick={(e) => {
                e.preventDefault();
                window.location.href='https://www.twitter.com/';
                }}class="btn btn-primary ms-lg-3 ms-3">
                <i class="bi bi-twitter"></i>
                </button>
                
                <button onClick={(e) => {
                e.preventDefault();
                window.location.href='https://www.instagram.com/';
                }}class="btn btn-primary ms-lg-3 ms-3">
                <i class="bi bi-instagram"></i>
                </button>
                
                <a href="https://google.com" target="_blank" rel="noreferrer">
                Google.com
                </a>
                
                </div>

                
              </div>
            </div>

          </div>
          
        </div>
        
      </div>
    );
}


export default Slider2;
